import { Box, styled } from "@mui/system";

const CustomLeftBox = styled(Box)(({ theme }) => ({
  padding: theme.spacing(2),
  textAlign: "left",
  alignItems: "center",
  justifyContent: "center",
}));

export default CustomLeftBox;
